import './App.css';
import Card from './components/Card';

function App() {
  const [cards, setNewCards] = useState([]);
  return (
    <div className="study-cards">
      {cards.map(card => {
        return <Card />;
      })}
      <h1>Study Cards</h1>
    </div>
  );
}

export default App;
